            //             <Link to={`/admin/dashboard/kolcsonzesek/edit-rental/${rentals.id}`}>
            //             <button className="edit-button">Szerkesztés <img className="edit-icon" src={edit_icon} alt="" /> </button>
            //             </Link>
            //             </td>
            //             </tr>
                        
            //             ))

TableContent = (
        <Grid
        data={[
           
                        
                        rentalList.kolcsonzes_id,
            
                        rentalList.kolcsonzo_telefon,
                        rentalList.kolcsonzott_modell,
                        rentalList.kolcsonzes_start,
                        rentalList.kolcsonzes_end,
                        rentalList.statusz,
                        rentalList.fizetendo,
    
                        // <Link to={`/admin/dashboard/kolcsonzesek/edit-rental/${rentalList.id}`}>
                        // <button className="edit-button">Szerkesztés <img className="edit-icon" src={edit_icon} alt="" /></button>
                        // </Link>
                       
                        
                      

        ]}
            columns={['Kölcsönzési azonosító','Kölcsönző neve', 'Kölcsönző telefonszáma',
            'Kölcsönzött modell', 'Kölcsönzés kezdete', 'Kölcsönzés vége', 'Státusz', 'Fizetendő']}
            search={true}
            pagination={{
            enabled: true,
            limit: 10,
  }}
/>

)




}











     


    




















